import React, { Component } from 'react';

class AddIcon extends Component {

    render() {
        const plusStyle = {
            'font-size': '100%'
          };
        return <div>
            <button type="submit" className="btn btn-primary rounded-circle btn-lg mb-4 mr-4 fixed-bottom">
                <span style={plusStyle}>+</span>
            </button>
        </div>
    }
}

export default AddIcon;
